import React from "react";
class BinComponent extends React.Component{
    constructor(props){
        super(props)
    }
    render(){
        
        const {deletedTask,restoredTask}=this.props
        return(
            <div>
                <h4 className="dthead">Deleted Tasks</h4>
                {
                    deletedTask.map((item)=>(
                        <div className="card">
                            <h5 className="card-header">{item.taskname}</h5>
                            <div className="card-body">
                            <p>{item.taskdesc}</p>
                            <button className='btn btn-primary' onClick={()=>restoredTask(item.id)} >restore</button>
                            </div>
                        </div>
                    ))
                }
            </div>

        )
    }
}
export default BinComponent
